"*it is relevant to their notability; 
it is not contentious; 
it is not unduly self-serving; 
it does not involve claims about third parties; 
it does not involve claims about events not directly related to the subject; 
there is no reasonable doubt as to who wrote it; 
the article is not based primarily on such sources. 

Thus, such matters as circulation figures, which could be considered subject to self-interest, are not something that can be sourced to the JFP's own blog. The source of the name, on the other hand, seems to be an acceptable item.   | Talk 
I'm just dumbfounded that the info isn't on their own web site, in any form other than off in their own wiki. How does JFP present ad-rates without readership and circulation numbers? Having purchased advertising before, I know this is an essential part of ad-rate packaging so that the publication/station can justify its rates. Brian, if you all have this as part of an ad-rate package, maybed PDF it and upload it to JFP's site, then reference it? "

